    },
  ];

function MovieList() {
    const [movies, setMovies] = useState(tempMovieData);
    return (
      <ul className="list">
        {movies?.map((movie) => (
          <Movie movie={movie}/>
        ))}
      </ul>
    );
  }

export default MovieList
